import React, { Component } from 'react';

class Watchlist extends Component {

  constructor() {
    super();
    this.state = {
      watchlist : []
    }
  }

  componentDidMount() {
    fetch('http://127.0.0.1:5070/watchlist')
    .then(results => this.setState({watchlist : results.json()}));

  }

  render() {
    return (
      <div>
        {this.state.watchlist}
      </div>
    );
  } 
}

export default Watchlist;
